import React from 'react'
import { Grid,Box } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({

    bord:{
        border:'1px solid red'
    }

    ,bord1:{
        border: '1px solid black'
    }

    ,bord2:{
        border: '1px solid green'
    }
    ,bord3:{
        border: '1px solid blue'
    }

    ,root: {
        flexGrow: 1,
      },
    
});


export const JobCard = ({job}) => {

 
    const classes = useStyles();
    const {company,logo,featured,position,role,level,postedAt,contract,location,languages,tools} = job;

    console.log(logo);
  

    return (
        <div className={classes.root}  >
 
            <Box >
                <Grid container className={classes.bord1} spacing={2} >

                    <Grid item md={3} xs={12}className={classes.bord}  >
                        <img src="../../images/photosnap.svg" alt={company} />
                        
                    </Grid>

                    <Grid  item md={3} xs={12} className={classes.bord2} >
                        {level}
                    </Grid>

                    <Grid item md={6} xs={12}className={classes.bord3} >
                        <p>
                        {contract}
                        </p>
                       
                    </Grid>

                </Grid>
            </Box>
            
            
           

        </div>
    )
}
